webpackJsonp([0xcb97aa156fe3],{9102:function(e,t){e.exports={pathContext:{group:[{node:{fields:{title:"Prairie Town",date:"18 Dec 2001",slug:"/2001-12-18-prairie-town/",tags:"Y2001"},html:"<p>After a week in the Twin Cities, and no time to go online, we're now in rural Minnesota, with Christopher's grandparents. There's a little snow on the ground, but it's much too warm for Minnesota in December. The flight over was uneventful. Christopher bounced in his seat for the first 4 hours from Amsterdam to Minneapolis, slept for a couple of hours, then bounced the rest of the flight. His parents didn't sleep at all.</p>"},next:{fields:{title:"Frozen",date:"09 Dec 2001",slug:"/2001-12-09-frozen/"}},previous:{fields:{title:"Norwegian Lobster",date:"22 Dec 2001",slug:"/2001-12-22-norwegian-lobster/"}}},{node:{fields:{title:"Frozen",date:"09 Dec 2001",slug:"/2001-12-09-frozen/",tags:"Y2001"},html:'<p>Last post before <a href="http://weather.yahoo.com/forecast/Minneapolis_MN_US_f.html">vacation</a>! </p>\n<p>We survived our flash trip to Munich. The party was in Bad Wiessee, 45 minutes out by bus, picturesque I\'m sure if it hadn\'t been dark. The trip back to Munich was an adventure: 2:20 am, dark, cold, no coat, no phone, no taxi, wakeup call at 6:15 am.</p>\n<p>Since we\'re in the Twin Cities anyway, I understand there\'s an <a href="http://www.apple.com/retail/">Apple Store</a> at <a href="http://www.apple.com/retail/mallofamerica/">Mall of America</a>.</p>\n<p>Note to self: http://sunlog.sunflyer.ch/</p>\n<p>I sold my soul last week und updated my Windows 98 partition to XP, mainly so I could process digital video without having to break my brain. My first impression is good. My primary OS for the past 7 years has been Linux (since kernel 0.99something), and will continue to be, but I don\'t have to be ashamed to boot up XP once in a while (or use in in a controlled space like <a href="http://www.vmware.com">VMWare</a>).</p>\n<p><a href="http://scobleizer.ManilaSites.Com/2001/12/09">If I only had a month to live</a>, I\'d fly without luggage!</p>'},next:{fields:{title:"Frantic",date:"06 Dec 2001",slug:"/2001-12-06-frantic/"}},previous:{fields:{title:"Prairie Town",date:"18 Dec 2001",slug:"/2001-12-18-prairie-town/"}}},{node:{fields:{title:"Frantic",date:"06 Dec 2001",slug:"/2001-12-06-frantic/",tags:"Y2001"},html:'<p>Here\'s my schedule for the next 6 days. </p>\n<ul>\n<li>Last day of work, have about a week\'s worth of stuff to finish up, company Christmas party in evening.\n</li>\n<li>Fly to Munich for Mama\'s national company Christmas party in evening (hopefully <i>without</i> traditional Bavarian music) ";->"\n</li>\n<li>Fly back from Munich, last chance to shop\n</li>\n<li>Pack, stores closed\n</li>\n<li>Fly to Minnesota (HAM-AMS-MSP)\n</li>\n<li>Collapse into coma</li>\n</ul>\n<p>Actually, I\'m ready for the coma part already.</p>\n<p>Ack! Today on the <a href="http://www.bildarchiv-hamburg.de/hamburg/strassen/millerntor/index2.htm">billboard across from my office</a> (pictures 3 and 4) they put up a giant 50 foot <a href="http://www.apple.com/ipod/">iPod</a>!</p>'},next:{fields:{title:"Still Working",date:"05 Dec 2001",slug:"/2001-12-05-still-working/"}},previous:{fields:{title:"Frozen",date:"09 Dec 2001",slug:"/2001-12-09-frozen/"}}}],pathPrefix:"",first:!1,last:!1,index:956,pageCount:1101}}}});
